"use strict";(self.webpackChunkdocs_onlinewardleymaps=self.webpackChunkdocs_onlinewardleymaps||[]).push([[849],{6164:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"About OnlineWardleyMaps","href":"/docs/intro","docId":"intro","unlisted":false},{"type":"link","label":"Quick Reference","href":"/docs/dsl-overview","docId":"dsl-overview","unlisted":false},{"type":"category","label":"Map Elements","items":[{"type":"link","label":"Anchor","href":"/docs/map-elements/anchor","docId":"map-elements/anchor","unlisted":false},{"type":"link","label":"Component","href":"/docs/map-elements/component","docId":"map-elements/component","unlisted":false},{"type":"link","label":"Links & Flows","href":"/docs/map-elements/link","docId":"map-elements/link","unlisted":false},{"type":"link","label":"Evolution","href":"/docs/map-elements/evolution","docId":"map-elements/evolution","unlisted":false},{"type":"link","label":"Inertia","href":"/docs/map-elements/inertia","docId":"map-elements/inertia","unlisted":false},{"type":"link","label":"Pipeline","href":"/docs/map-elements/pipeline","docId":"map-elements/pipeline","unlisted":false},{"type":"link","label":"Build, Buy, Outsource","href":"/docs/map-elements/build-buy-outsource","docId":"map-elements/build-buy-outsource","unlisted":false},{"type":"link","label":"Market & Ecosystem","href":"/docs/map-elements/market","docId":"map-elements/market","unlisted":false},{"type":"link","label":"Accelerators & Deaccelerators","href":"/docs/map-elements/accelerator","docId":"map-elements/accelerator","unlisted":false},{"type":"link","label":"Pioneers, Settlers, & Town Planners (PST)","href":"/docs/map-elements/pst","docId":"map-elements/pst","unlisted":false},{"type":"link","label":"Notes","href":"/docs/map-elements/note","docId":"map-elements/note","unlisted":false},{"type":"link","label":"Annotations","href":"/docs/map-elements/annotations","docId":"map-elements/annotations","unlisted":false},{"type":"link","label":"Submaps & URLs","href":"/docs/map-elements/submap","docId":"map-elements/submap","unlisted":false}],"collapsed":true,"collapsible":true,"href":"/docs/category/map-elements"},{"type":"category","label":"Map Features","items":[{"type":"link","label":"Map Title","href":"/docs/map-features/map-title","docId":"map-features/map-title","unlisted":false},{"type":"link","label":"Styles","href":"/docs/map-features/style","docId":"map-features/style","unlisted":false},{"type":"link","label":"Drag and Drop","href":"/docs/map-features/drag-drop","docId":"map-features/drag-drop","unlisted":false},{"type":"link","label":"Element Renaming","href":"/docs/map-features/element-renaming","docId":"map-features/element-renaming","unlisted":false},{"type":"link","label":"Map Iterations","href":"/docs/map-features/iterations","docId":"map-features/iterations","unlisted":false},{"type":"link","label":"Map Canvas Size","href":"/docs/map-features/map-canvas-size","docId":"map-features/map-canvas-size","unlisted":false},{"type":"link","label":"Evolution Axis","href":"/docs/map-features/evolution","docId":"map-features/evolution","unlisted":false},{"type":"link","label":"Quick Add & Quick Link","href":"/docs/map-features/features-quick-add-link","docId":"map-features/features-quick-add-link","unlisted":false},{"type":"link","label":"Editor and Map Resizing","href":"/docs/map-features/editor-map-resize","docId":"map-features/editor-map-resize","unlisted":false},{"type":"link","label":"Localisation & Language Support","href":"/docs/map-features/localisation","docId":"map-features/localisation","unlisted":false}],"collapsed":true,"collapsible":true,"href":"/docs/category/map-features"},{"type":"link","label":"Examples","href":"/docs/examples","docId":"examples","unlisted":false},{"type":"html","value":"<hr style=\\"margin: 1em 0;\\">"},{"type":"link","label":"VS Code Wardley Maps Extension","href":"/docs/vscode-extension","docId":"vscode-extension","unlisted":false},{"type":"link","label":"Obsidian Wardley Maps Plugin","href":"/docs/obsidian-plugin","docId":"obsidian-plugin","unlisted":false}]},"docs":{"dsl-overview":{"id":"dsl-overview","title":"Quick Reference","description":"OnlineWardleyMaps uses a Domain Specific Language (DSL) to define Wardley Maps in a concise, readable format. This DSL allows you to create, edit, and share maps as plain text, enabling version control and easy collaboration.","sidebar":"tutorialSidebar"},"dsl-reference":{"id":"dsl-reference","title":"DSL Reference","description":"OnlineWardleyMaps uses a Domain Specific Language (DSL) that enables you to create Wardley Maps using text. This reference guide covers all the available DSL commands and their syntax."},"examples":{"id":"examples","title":"Examples","description":"Below are practical examples of the OnlineWardleyMaps DSL, demonstrating how to define maps, components, flows, and more. These examples are based on real usage patterns and test cases.","sidebar":"tutorialSidebar"},"features":{"id":"features","title":"Features","description":"OnlineWardleyMaps is a powerful tool for creating, editing, and sharing Wardley Maps directly in your browser. It provides a rich set of features to help you visualize value chains, component evolution, and strategic context."},"intro":{"id":"intro","title":"About OnlineWardleyMaps","description":"The source code that runs www.OnlineWardleyMaps.com. Also available as a standalone Visual Studio Code extension\u2014vscode-wardley-maps\u2014and as an Obsidian plugin.","sidebar":"tutorialSidebar"},"map-elements/accelerator":{"id":"map-elements/accelerator","title":"Accelerators & Deaccelerators","description":"Accelerators and deaccelerators are special map elements that help visualize forces of change on your Wardley Map.","sidebar":"tutorialSidebar"},"map-elements/anchor":{"id":"map-elements/anchor","title":"Anchor","description":"Every map starts with an anchor\u2014the user or stakeholder need. This sets the context for all dependencies and components below.","sidebar":"tutorialSidebar"},"map-elements/annotations":{"id":"map-elements/annotations","title":"Annotations","description":"Annotations allow you to add numbered notes or comments to specific locations on your Wardley Map.","sidebar":"tutorialSidebar"},"map-elements/build-buy-outsource":{"id":"map-elements/build-buy-outsource","title":"Build, Buy, Outsource","description":"Build, Buy, Outsource are execution strategies for components. They help you highlight how a component will be delivered\u2014whether you will build it in-house, buy it from a supplier, or outsource it to a third party.","sidebar":"tutorialSidebar"},"map-elements/component":{"id":"map-elements/component","title":"Component","description":"A component is any situation-relevant thing on a Wardley Map. Components can be activities (what you do), practices (how you do it), data, or knowledge. There is no single right level of granularity\u2014if something is important, it deserves a symbol on the map. Components can be broken down into smaller components as needed.","sidebar":"tutorialSidebar"},"map-elements/evolution":{"id":"map-elements/evolution","title":"Evolution","description":"The evolution axis (horizontal) shows how components move from genesis (novel, unpredictable) to commodity (well-known, ubiquitous). Mapping the stage of evolution helps you understand certainty, market maturity, and strategic options.","sidebar":"tutorialSidebar"},"map-elements/inertia":{"id":"map-elements/inertia","title":"Inertia","description":"Inertia represents resistance to change for components on your Wardley Map. Components marked with inertia indicate areas where change is slow or difficult.","sidebar":"tutorialSidebar"},"map-elements/link":{"id":"map-elements/link","title":"Links & Flows","description":"Links (or flows) represent dependencies between components. In Wardley Mapping, a component higher on the map depends on a component lower down. These dependencies form the value chain, showing how needs are met through supporting capabilities.","sidebar":"tutorialSidebar"},"map-elements/market":{"id":"map-elements/market","title":"Market & Ecosystem","description":"A market is a special type of component that represents a market context or environment in your map. Markets help you visualize where competition, maturity, and commoditization are taking place.","sidebar":"tutorialSidebar"},"map-elements/note":{"id":"map-elements/note","title":"Notes","description":"Notes are versatile text elements that you can place anywhere on your map to add information, context, or reminders. They can be used to clarify intent, highlight risks, record insights, create legends, or provide additional context for your map.","sidebar":"tutorialSidebar"},"map-elements/pipeline":{"id":"map-elements/pipeline","title":"Pipeline","description":"A pipeline represents a flow or process that connects components across stages of evolution. Pipelines are used to simplify the notation of complex requirement chains, making maps easier to read and understand.","sidebar":"tutorialSidebar"},"map-elements/pst":{"id":"map-elements/pst","title":"Pioneers, Settlers, & Town Planners (PST)","description":"Wardley Maps support the visualization of organizational structure and evolution using the Pioneers, Settlers, and Town Planners (PST) model. These elements help you represent teams or roles responsible for different stages of evolution.","sidebar":"tutorialSidebar"},"map-elements/submap":{"id":"map-elements/submap","title":"Submaps & URLs","description":"A submap allows you to link a component to another Wardley Map or an external resource. This is useful for breaking down complex systems into manageable parts, or for referencing related maps and documentation.","sidebar":"tutorialSidebar"},"map-features/drag-drop":{"id":"map-features/drag-drop","title":"Drag and Drop","description":"OnlineWardleyMaps supports interactive element manipulation directly on the map, making it easier to position and rename map elements without manually editing the map code.  Movable elements will have a blue glow when pressing either CMD or CTRL.","sidebar":"tutorialSidebar"},"map-features/editor-map-resize":{"id":"map-features/editor-map-resize","title":"Editor and Map Resizing","description":"OnlineWardleyMaps provides a resizable split pane interface that allows you to adjust the relative sizes of the text editor and map canvas by dragging the divider between them.","sidebar":"tutorialSidebar"},"map-features/element-renaming":{"id":"map-features/element-renaming","title":"Element Renaming","description":"You can rename components in two ways:","sidebar":"tutorialSidebar"},"map-features/evolution":{"id":"map-features/evolution","title":"Evolution Axis","description":"The evolution axis is a core concept in Wardley Maps, representing how components evolve from left to right through four main stages: Genesis, Custom Built, Product, and Commodity. This axis helps visualize and understand the maturity and predictability of components in your map.","sidebar":"tutorialSidebar"},"map-features/features-quick-add-link":{"id":"map-features/features-quick-add-link","title":"Quick Add & Quick Link","description":"OnlineWardleyMaps supports quick ways to add and link components directly on the map, improving your workflow and reducing the need to edit code manually.","sidebar":"tutorialSidebar"},"map-features/iterations":{"id":"map-features/iterations","title":"Map Iterations","description":"Map iterations allow you to capture the evolution of a Wardley Map over time, preserving each stage of your mapping journey.","sidebar":"tutorialSidebar"},"map-features/localisation":{"id":"map-features/localisation","title":"Localisation & Language Support","description":"Online Wardley Maps provides comprehensive multilingual support, allowing you to use the interface in your preferred language and collaborate with global teams effectively.","sidebar":"tutorialSidebar"},"map-features/map-canvas-size":{"id":"map-features/map-canvas-size","title":"Map Canvas Size","description":"OnlineWardleyMaps allows you to override the default size of the map canvas using the DSL.","sidebar":"tutorialSidebar"},"map-features/map-title":{"id":"map-features/map-title","title":"Map Title","description":"You can set the title of your map using the DSL by specifying the title keyword followed by the desired title text.","sidebar":"tutorialSidebar"},"map-features/style":{"id":"map-features/style","title":"Styles","description":"Styles let you change the look and feel of your map to suit your audience or purpose.","sidebar":"tutorialSidebar"},"obsidian-plugin":{"id":"obsidian-plugin","title":"Obsidian Wardley Maps Plugin","description":"This plugin enables displaying and editing of Wardley Maps in the OnlineWardleyMaps format directly within Obsidian.","sidebar":"tutorialSidebar"},"vscode-extension":{"id":"vscode-extension","title":"VS Code Wardley Maps Extension","description":"The VS Code Wardley Maps extension enables you to create, edit, and visualize Wardley Maps directly within Visual Studio Code using the OnlineWardleyMaps DSL.","sidebar":"tutorialSidebar"}}}}')}}]);